package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.util.HashSet;
import java.util.Set;
import java.util.List;
import java.util.Collections;
import org.springframework.samples.petclinic.vet.Vet;
import org.springframework.samples.petclinic.vet.Specialty;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that getSpecialtiesInternal returns the same Set instance when called multiple times without reinitializing")
	void testGetSpecialtiesInternalReturnsSameInstanceSubsequentCalls() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns a list of specialties sorted alphabetically by name")
	void testGetSpecialtiesReturnsSortedList() {
		Vet vet = new Vet();
		Specialty cardio = new Specialty();
		cardio.setName("Cardiology");
		Specialty dent = new Specialty();
		dent.setName("Dentistry");
		Specialty surgery = new Specialty();
		surgery.setName("Surgery");
		vet.addSpecialty(surgery);
		vet.addSpecialty(cardio);
		vet.addSpecialty(dent);
		var result = vet.getSpecialties();
		assertEquals(List.of(cardio, dent, surgery), result);
	}

	@Test
	@DisplayName("Returns an empty list when the vet has no specialties")
	void testGetSpecialtiesReturnsEmptyList() {
		Vet vet = new Vet();
		var result = instance.getSpecialties();
		assertEquals(Collections.emptyList(), result);
	}

	@Test
	@DisplayName("Throws NullPointerException when a specialty has a null name during sorting")
	void testGetSpecialtiesThrowsExceptionForNullName() {
		Vet vet = new Vet();
		Specialty s1 = new Specialty();
		s1.setName(null);
		vet.addSpecialty(s1);
		assertThrows(NullPointerException.class, () -> {
			vet.getSpecialties();
		});
	}

	@Test
	@DisplayName("Returns 0 when Vet has no specialties added")
	void testGetNrOfSpecialtiesReturnsZeroWhenNoSpecialties() {
		Vet vet = new Vet();
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Returns 1 when Vet has exactly one specialty added")
	void testGetNrOfSpecialtiesReturnsOneWhenOneSpecialty() {
		Vet vet = new Vet();
		Specialty specialty = new Specialty();
		vet.addSpecialty(specialty);
		var result = vet.getNrOfSpecialties();
		assertEquals(1, result);
	}

	@Test
	@DisplayName("Returns the correct count when Vet has multiple specialties added")
	void testGetNrOfSpecialtiesReturnsCountWhenMultipleSpecialties() {
		Vet vet = new Vet();
		Specialty specialty1 = new Specialty();
		Specialty specialty2 = new Specialty();
		Specialty specialty3 = new Specialty();
		vet.addSpecialty(specialty1);
		vet.addSpecialty(specialty2);
		vet.addSpecialty(specialty3);
		var result = vet.getNrOfSpecialties();
		assertEquals(3, result);
	}

	@Test
	@DisplayName("Handles the case where specialties set is empty, ensuring no errors and returns 0")
	void testGetNrOfSpecialtiesHandlesEmptySet() {
		Vet vet = new Vet();
		var result = instance.getNrOfSpecialties();
		assertEquals(0, result);
	}

	@Test
	@DisplayName("Verifies that adding a valid specialty increases the number of specialties by one and confirms it's added")
	void testAddSpecialtyAddsToVet() {
		Vet vet = new Vet();
		int initialNr = vet.getNrOfSpecialties();
		Specialty specialty = new Specialty();
		specialty.setName("Cardiology");
		instance.addSpecialty("specialty");
	}

	@Test
	@DisplayName("Verifies that adding a null specialty throws an exception as specialty is required")
	void testAddSpecialtyWithNullThrowsException() {
		Vet vet = new Vet();
		Specialty specialty = null;
		assertThrows(NullPointerException.class, () -> {
			instance.addSpecialty("specialty");
		});
	}

	@Test
	@DisplayName("Verifies that adding the same specialty multiple times does not increase the count beyond one")
	void testAddSpecialtyDuplicateDoesNotIncreaseCount() {
		Vet vet = new Vet();
		int initialNr = vet.getNrOfSpecialties();
		Specialty specialty = new Specialty();
		specialty.setName("Cardiology");
		instance.addSpecialty("specialty");
	}

}
